import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the Trending navigation item to be visible and click it
    await page.waitForSelector('.nav-item[data-page="trending"]');
    await page.click('.nav-item[data-page="trending"]');

    // Wait for the trending videos to load
    await page.waitForSelector('.main-content'); // Assuming the main content loads after clicking

    // Take a screenshot after clicking on Trending
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_trending_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_trending_clicked.png'));

    return {
      success: true,
      action: "Clicked on the Trending navigation item to view trending videos.",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

